import React,{useEffect,useState} from 'react';
import { useParams } from 'react-router-dom';

function Details({name}) {



  const [info, setInfo] = useState([]);
  const id=useParams()





  useEffect(()=>{
    console.log(id)
    fetch("http://localhost:8090/"+name+"/"+id.id).then((result)=>{
      result.json().then((resp)=>{
       // console.warn(resp.data);
        setInfo(resp)

      })

    })
  },[id])

  console.warn(info)

  return (


    <div className="App">








      <table border="1">
        <tbody>
        <div>
        <p>ID</p>
        <p>Deadline Date</p>
        <p>Title</p>
        <p>Source URL</p>
        </div>
        <div className='content'> 
        {info.map((item, i)=>
            <div key={i} >
            <p>{item.id}</p>
            <p>{item.deadline_date}</p>
            <p>{item.title}</p>
            <p>{item.src_url}</p>
            </div>


      )}
      </div>

</tbody>
      </table>



    </div>
  );
}

export default Details;
